import Nav from 'react-bootstrap/Nav'
import React from 'react';

function Navbar(){

    const nav_items_left = [
        { key: "home", title: "Hem", href: "#home"},
        { key: "events", title: "Pub & Event", href: "#events"},
        { key: "km", title: "Klubbm채steriet", href: "#km" },
        { key: "contact", title: "Klubbm채steriet", href: "#contact" }
    ];

    const nav_items_right = [
        { key: "login", title: "Logga in" },
    ];

    const content_left = nav_items_left.map((item) => NavItem(item));
    const content_right = nav_items_right.map((item) => NavItem(item));

    return (
        <Nav className={"clearfix"}>
            <div className={"left"}>
                { content_left }
            </div>

            <div className={"right"}>
                { content_right }
            </div>
        </Nav>
    )
}

function NavItem(item){
    return (
        <Nav.Item>
            <Nav.Link activeKey={item.key}> {item.title} </Nav.Link>
        </Nav.Item>
    )
}

export default Navbar
